#
# TABLE STRUCTURE FOR: blogs
#

DROP TABLE IF EXISTS `blogs`;

CREATE TABLE `blogs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название стратьи',
  `text_blog` blob DEFAULT NULL COMMENT 'описание стратегии',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя - автора блога',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Блог';



#
# TABLE STRUCTURE FOR: comments
#

DROP TABLE IF EXISTS `comments`;

CREATE TABLE `comments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `blog_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на блог',
  `text_message` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'комметарий',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Комментарий';



#
# TABLE STRUCTURE FOR: dopnik_avto
#

DROP TABLE IF EXISTS `dopnik_avto`;

CREATE TABLE `dopnik_avto` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `Name` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Буква допника',
  `percent` float unsigned NOT NULL COMMENT 'Процент по доп соглашению',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Список доп соглашений автоследования';



#
# TABLE STRUCTURE FOR: dopnik_signal
#

DROP TABLE IF EXISTS `dopnik_signal`;

CREATE TABLE `dopnik_signal` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `Name` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Буква допника',
  `price` int(10) unsigned NOT NULL COMMENT 'Стоимость сигнала',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Список доп соглашений сигналов';



#
# TABLE STRUCTURE FOR: interest
#

DROP TABLE IF EXISTS `interest`;

CREATE TABLE `interest` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` enum('Начать торговать','Технический аналаз','Фундаментальный анализ','Российские акции','Срочный рынок','Зарубежные рынки','Форекс','Интрадей','Инвестиционный портфель','Скальпинг','Механические торговые системы','Торговые роботы') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'интерес',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='интересы';



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя - отправитель',
  `to_user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя - получатель',
  `text_message` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'сообщение',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Сообщения';



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `second_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Отчесво пользователя',
  `birthday` date DEFAULT NULL COMMENT 'Дата рождения',
  `gender` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Пол',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон',
  `aboute_my` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'о себе',
  `aboute_work` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'род занятий',
  `aboute_stock` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'о фондовом рынке',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Профили';



#
# TABLE STRUCTURE FOR: scores
#

DROP TABLE IF EXISTS `scores`;

CREATE TABLE `scores` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя',
  `score_type` enum('Фондовый счет','Срочный счет','Единый счет','MMA') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'тип счета',
  `trading_code` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Торговый код счета',
  `show_score` tinyint(1) NOT NULL DEFAULT 1 COMMENT 'публичность счета',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время подключения счета',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `trading_code` (`trading_code`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Торговые счета';



#
# TABLE STRUCTURE FOR: strategy
#

DROP TABLE IF EXISTS `strategy`;

CREATE TABLE `strategy` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя - автора стратегии',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'название стратегии',
  `score_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на счет',
  `text_message` blob DEFAULT NULL COMMENT 'описание стратегии',
  `statistics` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Статистика по стратегии' CHECK (json_valid(`statistics`)),
  `min_summa` int(10) unsigned NOT NULL COMMENT 'Минимальная рекоменованная сумма',
  `Profit` float NOT NULL DEFAULT 0 COMMENT 'доходность за весь срок',
  `prosadka` float NOT NULL DEFAULT 0 COMMENT 'Дата начала работы стратегии',
  `ita` float NOT NULL DEFAULT 0 COMMENT 'Индекс частоты сделок',
  `dopnik_avto_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на таблицу допников на автоследования',
  `avto_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT 'Активна ли стратегия для подключения автоследования',
  `dopnik_signal_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на таблицу допников на сигналы',
  `signal_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT 'Активна ли стратегия для подключения сигналов',
  `risk_profile` enum('Консервативный','Умеренный','Агрессивный') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Риск профиль',
  `begin_date` datetime DEFAULT current_timestamp() COMMENT 'Дата начала работы стратегии',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Список доп соглашений сигналов';

#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `nik` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'НИК пользователя',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта',
  `Avatar` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Аватар',
  `password` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'passsword',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время регистрации пользователя',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `nik` (`nik`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Пользователи';



